$.DataTable = require('datatables.net');

class ViewLocation extends React.Component {
    constructor(props) {
        super(props);
        this.datatable = null;
        this.state = {
            designationList: [],
            loading: false,
            count: 1,
            activePage: "1",
            countPage: "",
            usePermList: ""
